import './App.css';
import Navbar from './components/Navbar';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <div>
      <Router>
       <Navbar/>
       <Route path="/"></Route>
      </Router>
    </div>
  );
}

export default App;
